#####################################################functions
def all_cell_tracks(terminal_cells,quantified_cells):
    all_tracks=pd.DataFrame()
    for i in terminal_cells:
        #i='L111010'
        track=[]
        for j in quantified_cells:
            if j in i:
                track.append(j)
        track.sort()        
        #track=ct.cell_name_transfer(track)
        all_tracks=pd.concat([all_tracks,pd.DataFrame(track)],axis=1)
    #all_tracks.columns=ct.cell_name_transfer(terminal_cells)
    all_tracks.columns=terminal_cells
    return all_tracks
